"original": |2-
        Any following extension data are not yet defined in this version
        of the protocol.  Such extension data can consist of zero or more
        NILs, strings, numbers, or potentially nested parenthesized lists
        of such data.  Client implementations that do a BODYSTRUCTURE
        fetch MUST be prepared to accept such extension data.  Server
        implementations MUST NOT send such extension data until it has
        been defined by a revision of this protocol.
"fixed": |-
  - Any following extension data are not yet defined in this version of the protocol.  Such extension data can consist of zero or more NILs, strings, numbers, or potentially nested parenthesized lists of such data.  Client implementations that do a BODYSTRUCTURE fetch MUST be prepared to accept such extension data.  Server implementations MUST NOT send such extension data until it has been defined by a revision of this protocol.
"ko": |-
  - 다음 확장 데이터는 이 프로토콜 버전에서 아직 정의되지 않았습니다.  이러한 확장 데이터는 0개 이상의 NIL, 문자열, 숫자 또는 잠재적으로 중첩된 괄호로 묶인 해당 데이터 목록으로 구성될 수 있습니다.  BODYSTRUCTURE 가져오기를 수행하는 클라이언트 구현은 이러한 확장 데이터를 허용하도록 준비되어야 합니다.  서버 구현은 이 프로토콜의 개정판에 의해 정의될 때까지 그러한 확장 데이터를 전송해서는 안 됩니다.
